import { Link } from "react-router-dom";
import "../stylesheets/UX.scss";

const UX = () => {
  return (
    <>
      <div className="ux">
        <Link to="/" className="">
          <span className="">landing</span>
        </Link>
        <Link to="/Front/" className="">
          <span className="">front-end developer</span>
        </Link>
      </div>
      <section className="ux__1">
        <img className="ux__1--image" src="" />
      </section>
      <section className="ux__2">
        <img className="ux__2--image" src="" />
      </section>
      <section className="ux__3">
        <img className="ux__3--image" src="" />
      </section>
    </>
  );
};

export default UX;
